@Component({
  selector: 'app-footer',
  templateUrl: './footer.component.html',
  styleUrls: ['./footer.component.scss']
})
export class FooterComponent {

}
<div class="footer">
  <div class="footer-content">
    <p class="footer-text">© 2023 ESTREMOR - Diseñado por Luis Andres Martinez Estremor.</p>
  </div>
</div>
